import * as React from 'react';
import { AppBar, Toolbar, Drawer, Box, List, ListItem, ListItemText, Button, Typography } from '@mui/material';
import logo from './logo.png';  // Make sure the path to your logo is correct

const Navbar = () => {
  const [drawerOpen, setDrawerOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setDrawerOpen(!drawerOpen);
  };

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center', width: 250 }}>
      <List>
        <ListItem button>
          <ListItemText primary="Home" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="About" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Services" sx={{ textAlign: 'center' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Contact" sx={{ textAlign: 'center' }} />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <AppBar position="absolute" sx={{ width: '100%', background: 'rgba(220, 220, 220, 1.0)', boxShadow: 'none', padding: '20px 0' }}> {/* Padding added here for top and bottom spacing */}
      <Toolbar>
        {/* Logo on the left, with left margin for indentation */}
        <Box sx={{ position: 'absolute', left: 20, marginLeft: '30px' }}> {/* Additional marginLeft for indentation */}
          <img src={logo} alt="Logo" style={{ height: '50px' }} />
        </Box>

        {/* Centered menu items */}
        <Box sx={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
          <Button sx={{ mx: 5 }}>
            <Typography variant="h5" color="text.primary">Home</Typography>
          </Button>
          <Button sx={{ mx: 5 }}>
            <Typography variant="h5" color="text.primary">About</Typography>
          </Button>
          <Button sx={{ mx: 5 }}>
            <Typography variant="h5" color="text.primary">Contact the Team</Typography>
          </Button>
        </Box>
      </Toolbar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={handleDrawerToggle}
      >
        {drawer}
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
